/*!

=========================================================
* Black Dashboard React v1.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/black-dashboard-react
* Copyright 2019 Creative Tim (https://www.creative-tim.com)
* Licensed under MIT (https://github.com/creativetimofficial/black-dashboard-react/blob/master/LICENSE.md)

* Coded by Creative Tim

=========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.

*/
import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// react plugin used to create charts
import { Line } from "react-chartjs-2";

// reactstrap components
import {
  Button,
  ButtonGroup,
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  Row,
  Col,
  FormGroup,
  Input
} from "reactstrap";

// core components
import {
  chartExample1,
  chartExample2
} from "../variables/charts.jsx";

class Dashboard extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      bigChartData: "data1"
    };
  }
  setBgChartData = name => {
    this.setState({
      bigChartData: name
    });
  };
  render() {
    return (
      <>
        <div className="content">
        <Row>
          <Col lg="4">
            <Card className="card-chart">
              <CardHeader>
                <h5 className="card-category">Balance USD</h5>
                <CardTitle tag="h3">
                  <i className="tim-icons icon-wallet-43 text-info" />{" "}
                  0,00
                </CardTitle>
              </CardHeader>
              <CardBody>
              <h5 className="card-category"><Col lg="8">Balance LUSD: 0,00</Col></h5>
              </CardBody>
            </Card>
          </Col>
          <Col lg="4">
            <Card className="card-chart">
              <CardHeader>
                <h5 className="card-category">Balance EURO</h5>
                <CardTitle tag="h3">
                  <i className="tim-icons icon-wallet-43 text-success" />{" "}
                  0,00
                </CardTitle>
              </CardHeader>
              <CardBody>
              <h5 className="card-category"><Col lg="8">Balance LEURO: 0,00</Col></h5>
              </CardBody>
            </Card>
          </Col>
          <Col lg="4">
            <Card className="card-chart">
              <CardHeader>
                <h5 className="card-category">Balance GOLD</h5>
                <CardTitle tag="h3">
                  <i className="tim-icons icon-wallet-43 text-primary" />{" "}
                  0,00
                </CardTitle>
              </CardHeader>
              <CardBody>
              <h5 className="card-category"><Col lg="8">Balance LGOLD: 0,00</Col></h5>
              </CardBody>
            </Card>
          </Col>
        </Row>
        </div>
      </>
    );
  }
}

export default Dashboard;
